import React from "react";
import Common from "./Common";
import web from "../src/images/artboard.png";

const About = () => {
  return (
    <>
      <Common
        name="Grow your buisness with"
        imgsrc={web}
        visit="/service"
        btnname="Contact Now"
      />
    </>
  );
};

export default About;
